<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Request Password Reset</title>
    <style>
        /* Styles for the page */
        body {
            font-family: 'Arial', sans-serif;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            background-color: #1c1c1c;
            margin: 0;
        }

        .message-box {
            display: none;
            margin: 15px 0;
            padding: 12px;
            border-radius: 8px;
            font-size: 16px;
            text-align: center;
            animation: 0.5s fadeIn;
        }

        .message-box.success {
            background-color: #d4edda;
            color: #155724;
            border: 1px solid #c3e6cb;
        }

        .message-box.error {
            background-color: #f8d7da;
            color: #721c24;
            border: 1px solid #f5c6cb;
        }

        .message-box.warning {
            background-color: #fff3cd;
            color: #856404;
            border: 1px solid #ffeeba;
        }

        @keyframes fadeIn {
            from { opacity: 0; }
            to { opacity: 1; }
        }

        input[type="email"] {
            width: 80%;
            padding: 10px;
            margin: 10px 0;
            border-radius: 8px;
            border: none;
            background-color: #4a4a4a;
            color: #ddd;
            font-size: 16px;
        }

        button {
            padding: 10px 15px;
            background-color: #6e8efb;
            color: #fff;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            transition: background-color 0.3s;
        }

        button:hover {
            background-color: #5a7ddb;
        }
    </style>
</head>
<body>
    <div>
        <h2 style="color: #FFF;">Request Password Reset</h2>
        <form id="requestResetForm">
            <input type="email" id="email" placeholder="Enter your email" required>
            <div class="message-box error" id="errorMessage"></div>
            <div class="message-box success" id="successMessage"></div>
            <button type="submit">Send Reset Link</button>
        </form>
    </div>
